import React from "react";
import Main from "./components/Main";
import Header from "./components/Header";

function App() {
  let cartDisplayHelper = null;

  function handleMain (cartDisplayFunction) {
    cartDisplayHelper =  cartDisplayFunction;
  }

  return (
    <React.Fragment>
      <Header cartDisplay = {cartDisplayHelper}></Header>
      <Main handler={handleMain}></Main>
    </React.Fragment>
  );
}

export default App;
